      dots: "",
    },
    {
      id: 6,
      title: "figma",
      content: "figma",
      contents: "김아름",
      dots: "",
    },
    {
      id: 7,
      title: "responsibility",
      content: "responsibility",
      contents: "책임감",
      dots: "",
    },
  ];

  const delay = 2500;
  const [index, setIndex] = useState(0);

  const timeoutRef = useRef(null);

  function resetTimeout() {
    if (timeoutRef.current) {
      clearTimeout(timeoutRef.current);
    }
  }

  useEffect(() => {
    resetTimeout();
    timeoutRef.current = setTimeout(() => setIndex((prevIndex) => (prevIndex === data.length - 1 ? 0 : prevIndex + 1)), delay);

    return () => {
      resetTimeout();
    };
  });
  return (
    <Container id="skills">
      <Wrap>
        <TextLine01>
          <h3>KIMAHREUM</h3>
          <p>1989.03.07</p>
          <p>SEOUL MAPOGU</p>
        </TextLine01>
        <TextLine02>
          <h3>PHONENUMBER</h3>
          <p>010.2967.5037</p>
        </TextLine02>
        <TextLine03>
          <h3>E-MAIL</h3>
          <p>AARREUM0307@GMAIL.COM</p>
        </TextLine03>
        <TextLine04>
          <p>HTML</p>
          <p>CSS</p>
          <p>JAVASCRIPT</p>
          <p>REACT</p>
          <p>GITHUB</p>
        </TextLine04>
        {/* <TextLine05>
          <p>BUSAN UNIVERSITY OF FOREIGN STUDIES</p>
        </TextLine05> */}
      </Wrap>
    </Container>
  );
}

export default SectionAbout;

const Container = styled.div`
  position: relative;
  width: 100%;
  height: 600px;
`;

const Wrap = styled.div`
  width: 100%;
